import React from 'react';
import logo from './logo.svg';
import './App.css';
import PercentCircle from './PercentCircle';

function App() {

  const percentage = 80;

  return (
    <div className="App">
      <PercentCircle
        title={"Adoption Rate"}
        titleColor={'#B4BFD5'}
        percentage={percentage}
        size={150}
        strokeWidth={10}
        circleColor={"#305BF5"}
        textColor="#000"
       />
    </div>
  );
}

export default App;
